return ['domain'=>NULL,'plural-forms'=>'nplurals=3; plural=(n==1 ? 0 : n%10>=2 && n%10<=4 && (n%100<12 || n%100>14) ? 1 : 2);','language'=>'pl','pot-creation-date'=>'2025-09-04 10:00-0500','po-revision-date'=>'2025-09-04 10:00-0500','translation-revision-date'=>'2025-09-04 10:00-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sUruchamiasz ICS Calendar w implementacji WordPress Playground.%2$s Ponieważ ICS Calendar jest przeznaczony do uruchamiania na serwerze WWW, niektóre funkcje mogą być niedostępne lub mogą nie działać poprawnie.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sTwoja witryna używa obecnie ustawienia strefy czasowej opartej na przesunięciu UTC.%2$s Może to powodować błędy wyświetlania czasu w %3$s wtyczce w lokalizacjach, które przestrzegają czasu letniego. Proszę %4$szmienić ustawienie strefy czasowej%5$s na miasto najbliższe Twojej lokalizacji, w tej samej strefie czasowej, w celu prawidłowego wyświetlania czasu. Zobacz naszą %6$sdokumentację%7$s, aby uzyskać dodatkowe informacje na ten temat.','Utilities'=>'Narzędzia','Settings'=>'Ustawienia','User Guide'=>'Podręcznik użytkownika','Support'=>'Wsparcie','Upgrade to PRO!'=>'Uaktualnij do PRO!','Show/hide all'=>'Pokaż/ukryj wszystko','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Nie można pobrać pliku ICS lub był pusty. Sprawdź, czy adres URL jest poprawny i sprawdź konfigurację php.ini, aby sprawdzić, czy cURL lub allow_url_fopen jest dostępna. Jeśli spacje są używane do rozdzielenia wielu adresów URL, możesz również spróbować użyć znaku potoku. Adres URL, którego dotyczy problem:','Hide past events'=>'Ukryj minione wydarzenia','Show past events'=>'Pokaż wydarzenia które były już','Contact:'=>'Kontakt:','Resources:'=>'Zasoby:','Click for more...'=>'Kliknij, aby do coś więcej...','Save to your calendar'=>'Zapisz w kalendarzu','Cancelled'=>'Anulowane','The legacy parser option is deprecated and will be removed in a future update.'=>'Opcja starszego parsera jest przestarzała i zostanie usunięta w przyszłej aktualizacji.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Atrybut shortcode "currentweek" jest przestarzały. Zamiast tego użyj view="week" w swoim krótkim kodzie.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Atrybut shortcode "legendinline" jest przestarzały. Zamiast tego proszę użyć legendstyle="inline" w swoim shortcode.','Cleared %1$s %2$s transient(s).'=>'Wyczyszczone %1$s %2$s transient(y).','No %1$s transients were found.'=>'Nie znaleziono żadnych %1$s transjentów.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Wygląda na to, że adres URL kanału zawiera poświadczenia uwierzytelniania podstawowego HTTP. Spróbuj wyłączyć opcję %1$s w zakładce %2$s powyżej.','Use legacy feed request method'=>'Użyj starszej metody żądania feeda','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sTen adres URL wskazuje na plik w bibliotece multimediów.%2$s Chociaż powinieneś być w stanie użyć tego adresu URL w %3$s shortcode, będzie to statyczna migawka kalendarza w momencie utworzenia pliku i nie będzie odzwierciedlać żadnych przyszłych aktualizacji kalendarza źródłowego. Zapoznaj się z naszym %4$sPodręcznikiem użytkownika%5$s, aby uzyskać instrukcje dotyczące uzyskania prawidłowego dynamicznego adresu URL kanału.','Error: Could not resolve IP address for %1$s.'=>'Błąd: Nie można rozwiązać adresu IP dla %1$s.','Resolved IP address for %1$s:'=>'Rozwiązany adres IP dla %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Tekst wprowadzony w polu "Domyślny kod skrócony" nie jest prawidłowym kodem skróconym i nie został zapisany.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sUstawienia zostały zaktualizowane.%2$s Może być konieczne odświeżenie strony, aby zobaczyć niektóre zmiany.','calendar event'=>'wydarzenie kalendarzowe','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Starsza metoda żądania kanału jest przestarzała i zostanie usunięta w aktualizacji w najbliższej przyszłości. Przetestuj swoje kanały z wyłączoną starszą metodą żądania kanału.','Map'=>'Mapa','Recurring event'=>'Wydarzenie cykliczne','Recurs every %1$s years'=>'Powtarza się co %1$s lat','Recurs yearly'=>'Powtarza się co roku','Recurs every %1$s months'=>'Powtarza się co %1$s miesięcy','Recurs monthly'=>'Powtarza się co miesiąc','Recurs every %1$s weeks'=>'Powtarza się co %1$s tygodni','Recurs weekly'=>'Powtarza się co tydzień','Recurs every %1$s days'=>'Powtarza się co %1$s dni','Recurs daily'=>'Powtarza się codziennie','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Właściwość "url" w twoim %1$s shortcode wydaje się zawierać znaczniki HTML; najprawdopodobniej twój adres URL został zamieniony w klikalny link. W rezultacie Twój kalendarz może nie wyświetlać się poprawnie. Proszę usunąć klikalny link w shortcode.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcja r34ics_url_get_contents() nie jest już wspierana.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sUwaga:%2$s %3$s wersja 10.6 zmienia domyślne opcje dla kilku ustawień shortcode. W celu zachowania spójności, te nowe domyślne opcje są %4$snie%5$s włączone podczas aktualizacji z wcześniejszej wersji. Jeśli chcesz dowiedzieć się więcej o zmianach, przeczytaj nasz %6$swpis na blogu%7$s, lub aby przełączyć się na nowe domyślne ustawienia, włącz opcję %8$s na stronie %9$sustawień%10$s.','Use new parameter defaults (v.10.6)'=>'Użyj nowych wartości domyślnych parametrów (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sUwaga:%2$s %3$s wersja 11.0 usprawnia sposób pobierania adresów URL kanałów ICS. Zmiana ta wykorzystuje standardową wbudowaną funkcję WordPress, więc powinna być w pełni kompatybilna ze wszystkimi istniejącymi instalacjami. Jeśli napotkasz jakiekolwiek nowe problemy po aktualizacji do wersji 11 lub nowszej, odwiedź %4$sFora wsparcia WordPress%5$s, aby uzyskać pomoc.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sUwaga: %2$s %3$s Wersja 11.5.14.2 wprowadza nową, bezpieczniejszą metodę obsługi parametrów kalendarza podczas ładowania przez AJAX. Wyczyść wszystkie używane wtyczki buforujące, aby upewnić się, że kalendarze ładują się poprawnie przy użyciu nowej metody.','Add %1$s'=>'Dodaj %1$s','Close'=>'Zamknij','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Upewnij się, że używasz %1$ssubscribe%2$s URL, a nie %3$sweb view%4$s URL.%5$s (Wpisanie adresu URL bezpośrednio w przeglądarce internetowej powinno spowodować pobranie %6$s pliku)','Calendar Title:'=>'Tytuł kalendarza:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Pozostaw puste, aby użyć domyślnego tytułu kalendarza. Wprowadź %1$s, aby całkowicie pominąć tytuł.','Calendar Description:'=>'Opis kalendarza:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Pozostaw puste, aby użyć domyślnego opisu kalendarza. Wprowadź %1$s, aby całkowicie pominąć opis.','View:'=>'Widok:','month'=>'miesiąc','list'=>'lista','week'=>'tydzień','Count:'=>'Licznik:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Pozostaw %1$s puste, aby uwzględnić wszystkie nadchodzące wydarzenia. %2$s musi być standardowym %3$słańcuchem formatu daty PHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Pokaż opisy wydarzeń %1$s(zmień na liczbę w wstawionym shortcode, aby ustawić limit słów)%2$s','Show event locations %1$s(if available)%2$s'=>'Pokaż lokalizacje zdarzeń %1$s(jeśli dostępne)%2$s','Show event organizers %1$s(if available)%2$s'=>'Pokaż organizatorów imprez %1$s(jeśli dostępne)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sUwaga:%2$s Dodatkowe %3$sopcje wyświetlania%4$s są dostępne poprzez ręczną edycję shortcode po wstawieniu.','Insert %1$s'=>'Wstaw %1$s','Do even more with %1$s!'=>'Zrób jeszcze więcej z %1$s!','Calendar Builder'=>'Konstruktor kalendarzy','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Skonfiguruj wszystkie ustawienia kalendarza za pomocą łatwego interfejsu wizualnego... nie ma potrzeby ręcznego wpisywania skrótów.','Additional Views and Enhanced Features'=>'Dodatkowe widoki i ulepszone funkcje','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nowe sposoby wyświetlania kalendarza, w tym Pełny, Następny w górę, Masonry, Miesiąc z paskiem bocznym, Widżet i inne. Dodatkowe możliwości zostały dodane do podstawowych widoków Miesiąc, Podstawowy, Lista i Tydzień.','Customizer'=>'Dostosowanie','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Łatwo modyfikuj palety kolorów kalendarza, czcionki i nie tylko, w całej witrynie.','ICS Events'=>'Wydarzenia ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNowość!%2$s Zmienia %3$s w pełny system kalendarza. Twórz wydarzenia i zarządzaj nimi bezpośrednio w WordPress, a nawet płynnie integruj je z istniejącymi kanałami.','Visit %1$s to learn more.'=>'Odwiedź %1$s, aby dowiedzieć się więcej.','Go PRO!'=>'Idź PRO!','Getting Started'=>'Pierwsze kroki','System Report'=>'Raport systemu','Save Changes'=>'Zapisz zmiany','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Dziękujemy za zainstalowanie %1$s. Przed utworzeniem pierwszego shortcode\'u kalendarza, proszę odwiedzić stronę %2$sUstawienia ogólne%3$s i sprawdzić, czy język witryny, strefa czasowa i ustawienia formatu daty/czasu są poprawne. Więcej informacji znajdziesz w naszym %4$sPodręczniku użytkownika%5$s.','Quick Start Guide'=>'Skrócona instrukcja obsługi','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Obszerny %1$sPodręcznik użytkownika%2$s jest dostępny na naszej stronie internetowej. Poniżej znajduje się kilka szybkich linków do kluczowych zasobów w dokumentacji.','General:'=>'Ogólne:','General WordPress Settings'=>'Ogólne ustawienia WordPress','%1$s Settings'=>'ustawienia %1$s','Working with Shortcodes:'=>'Praca z kodami skrótów:','Shortcode Overview'=>'Przegląd krótkich kodów','Shortcode Builder'=>'Shortcode Builder','Shortcode Parameters Reference'=>'Odniesienie do parametrów shortcode','Advanced Topics:'=>'Tematy zaawansowane:','FAQs and Tips'=>'Najczęściej zadawane pytania i wskazówki','CSS Guide'=>'Przewodnik CSS','Developer Resources'=>'Zasoby dla deweloperów','GDPR'=>'RODO','Appearance'=>'Wygląd','Match calendar color palette to current Block Theme colors'=>'Dopasowanie palety kolorów kalendarza do bieżących kolorów motywu bloku','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Zastępuje domyślną neutralną paletę kolorów %1$s najbliższymi dopasowaniami z bieżącej palety kolorów Site Editor Styles lub pliku %2$s w motywie. Wybór kolorów jest algorytmiczny, a niektóre kombinacje mogą nie przejść testów kontrastu dostępności. To ustawienie nie ma wpływu, jeśli używasz "klasycznego" motywu, który nie zawiera pliku %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sJest to obecnie funkcja w wersji beta.%2$s Może wymagać wprowadzenia pewnych zmian w ustawieniach kalendarza lub CSS w celu optymalnego wyświetlania, zwłaszcza jeśli kanały są oznaczone kolorami. Funkcjonalność może ulec zmianie.','Dark mode'=>'Tryb ciemny','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Odwraca paletę kolorów (jasne kolory na ciemnym tle). %1$sUwaga: %2$s Tryb ciemny automatycznie stosuje również zmiany stylu podobne do parametrów %3$s i %4$s shortcode, więc nie trzeba ich uwzględniać w shortcode.','Loading'=>'Ładowanie','Always use AJAX to render calendars (recommended)'=>'Zawsze używaj AJAX do renderowania kalendarzy (zalecane)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Po zaznaczeniu tej opcji wszystkie kalendarze będą renderowane przez AJAX (asynchronicznie po załadowaniu strony). Jest to szczególnie przydatne w połączeniu z innymi wtyczkami buforującymi lub jeśli kalendarze zawierają dużą liczbę wydarzeń. Zwykle dane kalendarza są wysyłane bezpośrednio w kodzie HTML początkowego ładowania strony, chyba że w kodzie skróconym określono AJAX.','Increase memory limit when rendering calendars'=>'Zwiększenie limitu pamięci podczas renderowania kalendarzy','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Jeśli kalendarz nie ładuje się z błędem krytycznym "brak pamięci", spróbuj zwiększyć limit pamięci. Zalecane jest co najmniej 512 MB. %1$s Uwagi: 1) Niektórzy dostawcy usług hostingowych mogą nie zezwalać aplikacjom na zastępowanie domyślnego ustawienia serwera. 2) Nie jest możliwe ustawienie tej opcji poniżej bieżącego domyślnego limitu pamięci na serwerze.','deprecated'=>'przestarzały','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Jeśli Twoja witryna przestała pobierać kanały po aktualizacji wersji 11, włącz tę opcję, aby użyć starszej metody żądania. Ta funkcja jest przestarzała i zostanie usunięta w aktualizacji w najbliższej przyszłości.','Default shortcode'=>'Domyślny shortcode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Jeśli Twoja witryna będzie zawierać dużą liczbę podobnie skonfigurowanych skrótów kalendarza, możesz wprowadzić tutaj domyślny "podstawowy" skrót z parametrami, które powinny być takie same dla wszystkich kalendarzy. Poszczególne skróty w witrynie mogą następnie zawierać tylko parametry, które są unikalne dla tego kalendarza: %1$s Wszelkie parametry zawarte w indywidualnym kodzie skróconym zastąpią to, co jest tutaj ustawione.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Zezwalaj na dostęp do tych nazw hostów, które rozpoznają zarezerwowane adresy IP','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Jeśli serwer kalendarza jest hostowany na tym samym serwerze fizycznym co witryna, jest częścią tej samej sieci lokalnej lub w inny sposób korzysta z %1$szastrzeżonego adresu IP%2$s, wprowadź tutaj jego nazwę hosta, aby zezwolić na dostęp. W przypadku wielu serwerów kalendarza wprowadź jedną nazwę hosta w wierszu. Więcej informacji można znaleźć w %3$sdokumentacji %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Wprowadź jedną nazwę hosta w wierszu. Nazwy hostów to podstawowe nazwy domen, a nie pełne adresy URL. %1$sNa przykład należy wpisać %2$s, a nie %3$s.','Caching'=>'Buforowanie','Transient (cache) expiration'=>'Wygaśnięcie przejściowe (cache)','seconds'=>'sekund','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Ustawia, jak długo dane kanału kalendarza powinny być buforowane na serwerze (przejściowe WordPress) przed ponownym załadowaniem. Domyślnie jest to 3600 (1 godzina).','Miscellaneous'=>'Różne','Remove "Add ICS Calendar" button in Classic Editor'=>'Usunięcie przycisku "Dodaj kalendarz ICS" w Edytorze klasycznym','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Domyślnie Kalendarz ICS dodaje przycisk "Dodaj kalendarz ICS" do paska narzędzi nad edytorem WYSIWYG podczas korzystania z Edytora klasycznego. Zaznacz to pole, aby usunąć przycisk. Nie ma wpływu na witryny korzystające z edytora bloków (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s w wersji 10.6 wprowadzono nowe wartości domyślne dla kilku parametrów shortcode. Nowe instalacje automatycznie używają nowych wartości domyślnych, ale zaktualizowane instalacje będą nadal używać starych wartości domyślnych, chyba że to pole zostanie zaznaczone. Przeczytaj więcej o tych zmianach na %2$snaszym blogu%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Nasz kompletny podręcznik użytkownika jest dostępny z pełnym tłumaczeniem na dziesiątki języków na naszej stronie internetowej:','For assistance, please use our %1$ssupport request form%2$s.'=>'Aby uzyskać pomoc, skorzystaj z naszego %1$sformularza zapytania o wsparcie%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Kontaktując się z pomocą techniczną, należy załączyć %1$sRaport systemowy%2$s z tej strony.','Spread the word!'=>'Daj znać!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Jeśli uważasz, że %1$s jest przydatne, możesz wesprzeć nasz ciągły wzrost i rozwój, wystawiając %2$s pięciogwiazdkową recenzję%3$s. Dziękujemy!','%1$s Data Cache'=>'%1$s Data Cache','Clear Cached Calendar Data'=>'Wyczyść dane kalendarza w pamięci podręcznej','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Spowoduje to natychmiastowe wyczyszczenie wszystkich istniejących danych kalendarza w pamięci podręcznej (przeczyszczanie stanów przejściowych), zmuszając WordPress do przeładowania wszystkich kalendarzy przy następnym ich wyświetleniu. Buforowanie zostanie wznowione tak jak poprzednio.','ICS Feed URL Tester'=>'Tester adresu URL kanału ICS','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Jeśli obawiasz się, że wtyczka nie pobiera prawidłowo Twojego kanału, możesz przetestować adres URL tutaj.','Enter feed URL...'=>'Wpisz adres URL kanału informacyjnego...','Test URL'=>'Testowy adres URL','Results:'=>'Wyniki:','%1$s received.'=>'otrzymano %1$s.','This appears to be a valid ICS feed URL.'=>'Wydaje się, że jest to prawidłowy adres URL kanału ICS.','This does not appear to be a valid ICS feed URL.'=>'Nie wydaje się, aby był to prawidłowy adres URL kanału ICS.','Could not retrieve data from the requested URL.'=>'Nie można pobrać danych z żądanego adresu URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Wystąpił nieznany błąd podczas próby pobrania żądanego adresu URL.','Please copy the following text and include it in your message when emailing support.'=>'Skopiuj poniższy tekst i dołącz go do wiadomości podczas wysyłania wiadomości e-mail do pomocy technicznej.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Proszę również dołączyć %1$s shortcode dokładnie tak, jak masz go wpisanego na stronie, której dotyczy problem.','For your site security please do NOT post the System Report in the support forums.'=>'Dla bezpieczeństwa witryny proszę NIE umieszczać raportu systemowego na forum pomocy technicznej.','No events found.'=>'Nie znaleziono wydarzeń.','Previous Page'=>'Poprzednia strona','Next Page'=>'Następna strona','All Day'=>'Cały dzień','Today'=>'Dzisiaj','No events.'=>'Brak zdarzeń.','No additional events this month.'=>'Brak dodatkowych wydarzeń w tym miesiącu.','Last week'=>'Ostatni tydzień','This week'=>'W tym tygodniu','Next week'=>'Następny tydzień','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Zamień swój Kalendarz Google, Microsoft Office 365 lub Apple iCloud Calendar w płynnie zintegrowane, automatycznie aktualizowane, bezobsługowe doświadczenie WordPress.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
